import React, { useState } from 'react';
import Switch from '@material-ui/core/Switch';

const SwitchLanguage = () => {

    const [check,setCheck] = useState(false);

    const handleChange = () => {
        setCheck(!check);
    }

    return (
        <Switch
            checked={check}
            onChange={handleChange}
            name="checkedA"
      />
    );
}

export default SwitchLanguage;
